function mergeEncounterClinicalNoteUI(enc_CNs) {
	console.log(enc_CNs);
	enc_CN_List = [];
	messageForUser = '';
	try {
		if (enc_CNs?.Encounter.status === "rejected") {
			messageForUser = `${messageForUser}Server error while getting encounter`
		}
		if (enc_CNs?.DocumentReference.status === "rejected") {
			messageForUser =
				`${messageForUser}
				Server error while getting Clinical Note`
		}

		if ((enc_CNs?.Encounter.status === "rejected" || !(enc_CNs?.Encounter.value?.entry?.length > 0)) &&
			(enc_CNs?.DocumentReference.status === "rejected" || !(enc_CNs?.DocumentReference.value?.entry?.length > 0))) {    //  None present
			enc_CN_List = false;
			messageForUser = `Found nothing
			${",".concat(messageForUser)}`;
			working_Loaders.encounter.message = "Zero encounter and note found"
		} else {
			if (enc_CNs?.Encounter.value?.entry?.length > 0) {    // Set encounters list
				enc_CN_List = enc_CNs.Encounter.value.entry.map((eachEnc, encIndex) => {
					let participants = eachEnc.resource.participant.map((eachParti) => {
						if (eachParti?.individual) {
							return {
								type: eachParti.individual.reference.split("/")[0],
								id: eachParti.individual.reference.split("/")[1]
							}
						}
						return false;
					})
					return {
						id: eachEnc.resource.id,
						patientName: "__",
						start: eachEnc.resource.period.start,
						startDateTime: moment(eachEnc.resource.period.start).format("DD/MM/YYYY, hh:mm a"),
						startDate: moment(eachEnc.resource.period.start).format("DD/MM/YYYY"),
						startTime: moment(eachEnc.resource.period.start).format("hh:mm a"),
						end: eachEnc.resource.period.end,
						endDateTime: moment(eachEnc.resource.period.end).format("DD/MM/YYYY, hh:mm a"),
						endDate: moment(eachEnc.resource.period.end).format("DD/MM/YYYY"),
						endTime: moment(eachEnc.resource.period.end).format("hh:mm a"),
						duration: moment(eachEnc.resource.period.end).diff(moment(eachEnc.resource.period.start), 'minutes') + ":" + moment(eachEnc.resource.period.end).diff(moment(eachEnc.resource.period.start), 'seconds') % 60,
						subjectReference: {
							patientName: "__",
							type: eachEnc.resource.subject.reference.split("/")[0],
							id: eachEnc.resource.subject.reference.split("/")[1]
						},
						class: eachEnc.resource.class,
						participants: participants,
						resourceType: eachEnc.resource.period.resourceType,
						clinicalNotes: false,
						status: "Completed",
					}
				});
			}

			// Notes without encounter
			enc_CN_List.push({
				id: "extra",
				patientName: "___",
				type: "___",
				startDateTime: "other notes",
				startDate: "other notes",
				startTime: "",
				endTime: "__",
				endDateTime: "__",
				status: "__",
				clinicalNotes: [],
				duration: "",
				participants: ""
			});

			// Set CNs in each encounter
			if (enc_CNs?.Encounter.value?.entry?.length > 0) {
				let noEncCNs = [];
				let indexesOfCN = [];
				// Identify the attached enc and put CN in that enc>clinicalNotes else
				// move CNs to var "noEncCNs"
				enc_CNs?.Encounter.value?.entry.forEach((cnJson, indexCN) => {
					console.log(JSON.stringify(cnJson))
					let cnArray = [];
					if (cnJson.encRefIds && cnJson.encRefIds.includes(encJson.id)) {
						cnArray.splice(cnArray.length, 0, cnJson);
						indexesOfCN.splice(indexesOfCN.length, 0, indexCN);
					}
					encJson.clinicalNotes = (cnArray.length > 0) ? cnArray : false;
				});
				indexesOfCN.reverse().forEach(item => { tableClinicalNoteDataCopy.splice(item, 1); });
			} else
				messageForUser = `${messageForUser}No CN Found`
		}
	} catch (error) {
		tableClinicalNoteData = false;
		callToast('Error in merge Encounter-ClinicalNote for UI', error.message, 'error', 'dismissible');
		console.error(error.message);
	}
	printData(enc_CN_List);
}





















